import React, { useState } from 'react';
import './PremiumPlans.css';

const PremiumPlans = ({ user, onSubscribe, onClose }) => {
  const [selectedPlan, setSelectedPlan] = useState(null);

  const plans = [
    {
      id: 'basic',
      name: 'Basic',
      price: 'â‚¹199',
      period: 'month',
      description: 'Essential mental wellness features',
      features: [
        'Advanced mood insights',
        'Extra voice options',
        'Basic breathing exercises',
        'Limited journal analysis'
      ],
      popular: false
    },
    {
      id: 'pro',
      name: 'Pro',
      price: 'â‚¹499',
      period: 'month',
      description: 'Complete mental wellness suite',
      features: [
        'All Basic features',
        'Unlimited coins',
        'All games unlocked',
        'Advanced AI Coach',
        'Sleep stories',
        'Priority support'
      ],
      popular: true
    },
    {
      id: 'elite',
      name: 'Elite',
      price: 'â‚¹999',
      period: 'month',
      description: 'Premium experience with exclusive benefits',
      features: [
        'All Pro features',
        'Exclusive themes & avatars',
        'Early access to new features',
        'Personalized coaching',
        'VIP support'
      ],
      popular: false
    },
    {
      id: 'elite',
      name: 'Elite',
      price: 'â‚¹1999',
      period: 'year',
      description: 'Premium experience with exclusive benefits',
      features: [
        'All Pro features',
        'Exclusive themes & avatars',
        'Early access to new features',
        'Personalized coaching',
        'VIP support'
      ],
      popular: false
    },
    {
      id: 'lifetime',
      name: 'Lifetime',
      price: 'â‚¹4999',
      period: 'one-time',
      description: 'Forever access to all premium features',
      features: [
        'Everything in Elite',
        'Lifetime access',
        'Special lifetime badge',
        'Free future updates',
        'Exclusive community',
        'Founder status'
      ],
      popular: false
    }
  ];

  const handleSubscribe = async (planId) => {
    try {
      const response = await fetch('/premium/subscribe', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          user_id: user.id,
          plan: planId
        })
      });

      if (response.ok) {
        const result = await response.json();
        onSubscribe(planId);
        alert('ðŸŽ‰ Welcome to MoodMate Premium! Your subscription is active.');
        onClose();
      } else {
        alert('There was an error processing your subscription. Please try again.');
      }
    } catch (error) {
      console.error('Subscription error:', error);
      alert('Network error. Please check your connection and try again.');
    }
  };

  return (
    <div className="premium-plans-overlay">
      <div className="premium-plans-container">
        <button className="close-plans-btn" onClick={onClose}>Ã—</button>
        
        <div className="plans-header">
          <h2>ðŸŒŸ Upgrade to MoodMate Premium</h2>
          <p>Choose the plan that's right for your mental wellness journey</p>
        </div>

        <div className="plans-grid">
          {plans.map(plan => (
            <div 
              key={plan.id} 
              className={`plan-card ${plan.popular ? 'popular' : ''} ${selectedPlan === plan.id ? 'selected' : ''}`}
              onClick={() => setSelectedPlan(plan.id)}
            >
              {plan.popular && <div className="popular-badge">MOST POPULAR</div>}
              {plan.id === 'lifetime' && <div className="lifetime-badge">ðŸ”¥ LIFETIME</div>}
              
              <h3>{plan.name}</h3>
              <div className="plan-price">
                {plan.price}
                <span className="plan-period">/{plan.period}</span>
              </div>
              
              <p className="plan-description">{plan.description}</p>
              
              <ul className="plan-features">
                {plan.features.map((feature, index) => (
                  <li key={index}>âœ“ {feature}</li>
                ))}
              </ul>
              
              <button 
                className={`select-plan-btn ${selectedPlan === plan.id ? 'selected' : ''}`}
                onClick={() => setSelectedPlan(plan.id)}
              >
                {selectedPlan === plan.id ? 'Selected' : 'Select Plan'}
              </button>
            </div>
          ))}
        </div>

        <div className="plans-actions">
          <button 
            className="subscribe-btn"
            disabled={!selectedPlan}
            onClick={() => handleSubscribe(selectedPlan)}
          >
            Subscribe Now
          </button>
          <p className="security-note">
            ðŸ”’ Secure payment. 7-day money-back guarantee.
          </p>
        </div>

        <div className="faq-section">
          <h4>Frequently Asked Questions</h4>
          <div className="faq-item">
            <h5>Can I cancel anytime?</h5>
            <p>Yes, you can cancel your subscription anytime from your profile settings.</p>
          </div>
          <div className="faq-item">
            <h5>Will I lose access if I cancel?</h5>
            <p>You'll maintain access until the end of your billing period.</p>
          </div>
          <div className="faq-item">
            <h5>Do you offer refunds?</h5>
            <p>We offer a 7-day money-back guarantee for all new subscriptions.</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PremiumPlans;
